import React from 'react';
import classNames from 'classnames';
import { EuiButtonEmpty } from '../button';
export var EuiPaginationButton = ({
  children,
  className,
  isActive,
  isPlaceholder,
  hideOnMobile,
  ...rest
}) => {
  const classes = classNames('euiPaginationButton', className, {
    'euiPaginationButton-isActive': isActive,
    'euiPaginationButton-isPlaceholder': isPlaceholder,
    'euiPaginationButton--hideOnMobile': hideOnMobile
  });
  return <EuiButtonEmpty className={classes} size="xs" color="text" isDisabled={isPlaceholder} {...rest}>
      {children}
    </EuiButtonEmpty>;
};
